import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Link, Routes, Route } from 'react-router-dom';
import GameForm from './GameForm';
import GameList from './GameList';

function App() {
  const [games, setGames] = useState([]);

  useEffect(() => {
    fetchGames();
  }, []);

  const fetchGames = async () => {
    try {
      // Mock data for testing
      const mockGames = [
        { id: 1, managerName: 'John', scheduledDateTime: '2024-01-08T10:00', admission: 'Free', description: 'Test game 1', availableSlots: 10 },
        { id: 2, managerName: 'Jane', scheduledDateTime: '2024-01-09T15:00', admission: 'Paid', description: 'Test game 2', availableSlots: 5 },
      ];
      setGames(mockGames);
    } catch (error) {
      console.error('Error fetching games:', error);
    }
  };

  const submitNewGame = async (newGameDetails) => {
    try {
      // Mock endpoint for testing
      const response = await fetch('https://example.com/api/games', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(newGameDetails),
      });
      const data = await response.json();
      console.log('New game added:', data);
    } catch (error) {
      console.error('Error adding new game:', error);
    }
  };

  return (
    <Router>
      <div className="app">
        <header>
          <h1>Pickup Game App</h1>
        </header>

        <section className="content">
          <Routes>
            <Route path="/add-game">
              <GameForm onSubmit={submitNewGame} />
            </Route>
            <Route path="/">
              <div className="game-list">
                <h2>Available Games</h2>
                <GameList games={games} />
                <Link to="/add-game">
                  <button>Add New Game</button>
                </Link>
              </div>
            </Route>
          </Routes>
        </section>
      </div>
    </Router>
  );
}

export default App;
